            return list(range(1, n + 1))
        else:
            (k, count, p, l, x) = (k - n * (n + 1) // 2 + 1, 0, 0, [0] * n, 1)
            while k > 0:
                p += 2
                (k, count) = (k - n + p, count + 1)
            for i in range(n, n - count, -1):
                l[x] = i
                x += 2
            k = -k
            l[2 * count - 1 + k] = n - count + 1
            p = 1
            for i in range(n):
                if l[i] == 0:
                    l[i] = p
                    p += 1
            return l
    elif n == 1:
        return [1] if k == 0 else -1
    elif k < n * (n + 1) // 2 - 1 or k > 3 * (n // 2) * (n // 2 + 1):
        return -1
